import React from 'react'
import LoadingSvg from '../../../assetss/images/loader1.gif';
import ls from './LoaderStyles.module.css'
import classNames from "classnames";


let Preloader = (props) =>{
    const TaskExecutedStyleForWindow = classNames({
        [ls.small] : !props.completed,
        [ls.medium] : props.completed
    })
    return <img className={TaskExecutedStyleForWindow} src={LoadingSvg}/>
}
export default Preloader
